(2, 'Practicia - Rating & Comment', 'feeadback_practicia', 'Practicia - Rating & Comments', 'Practicia - Rating & Comments', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="border:1px solid #1595AE;letter-spacing:1px;box-shadow: 0px 0px 5px #D1D1D1;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="border-bottom:1px solid #F3F3F3;padding:10px;"><a href=""><img alt="PRACTICIA" height="50" src="{SITE_URL}/images/logo.png" width="158" /></a></td>\r\n			<td align="right" style="border-bottom:1px solid #F3F3F3;"><span style="font-family:georgia,serif;"><a href="" style="text-decoration:none;color:#000; \r\n        padding: 0px 10px;">Home</a> | How it Works&nbsp;| <a href="" style="text-decoration:none;color:#000; \r\n        padding: 0px 10px;">About </a> | <a href="" style="text-decoration:none;color:#000; \r\n        padding: 0px 10px;">Contact Us </a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="font-size:25px;padding:10px;"><span style="font-family:georgia,serif;">Comments and Ratings on PRACTICIA</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding: 20px 10px;"><span style="font-family:georgia,serif;"><strong>Comment details</strong><br />\r\n			<span style="letter-spacing: 1px; line-height: 20.7999992370605px;">Name : {NAME}</span><br />\r\n			User Type : {USER_TYPE}<br />\r\n			Comment : {COMMENT}<br />\r\n			Rating : {RATING}</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding:10px; ">\r\n			<p><span style="font-family:georgia,serif;">Thanks !</span></p>\r\n\r\n			<p><span style="font-family:georgia,serif;">The PRACTICIA Team<br />\r\n			The Practicia.com</span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align="center" colspan="2" style="padding:10px;border-top:1px solid #F3F3F3;">\r\n			<div><span style="font-family:georgia,serif;">Copyright 2008-2014 Practicia Inc., All Right Reserved</span></div>\r\n\r\n			<div><span style="font-family:georgia,serif;"><a href="" styl