(7, 'PRACTICIA - Forgot Username', 'practicia___forgot_username', 'PRACTICIA - Forgot Username', 'Forgot Username', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td colspan="2" style="font-size:25px;padding:10px;">Forgot Username</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding: 20px 10px;">You requested to know your credential, We found the details below<br />\r\n						{MESSAGE}</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding:10px; ">Thanks<br />\r\n						Practicia Team<br />\r\n						www.practicia.com</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', 'publish'),
(9, 'Your Upcoming Performance of Assignment, 2 Weeks to go!', 'your_upcoming_performance_of_assignment_2_weeks_to_go', 'Your Upcoming Performance of {ASSIGNMENT_NAME}, 2 Weeks to go!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td colspan="2" style="font-size:14px;padding:10px;">Hi {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding: 20px 10px;">We just wanted to remind you that you have an upcoming performance of {ASSIGNMENT_NAME} at the following event: {EVENT_DETAILS}. With two weeks to go, you should be getting done with any major technical challenges. Play large sections, even entire pieces at this point. Please let your teacher know if you have any questions about the piece. Good luck, we will check in again next week! Cheers!</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding:10px; ">Thanks<br />\r\n						Practicia Team<br />\r\n						www.practicia.com</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{EVENT_DETAILS}', 'publish'),
(10, 'Your Upcoming Performance of Assignment, 1 Week to go!', 'your_upcoming_performance_of_assignment_1_week_to_go', 'Your Upcoming Performance of {ASSIGNMENT_NAME}, 1 Week to go!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="font-size:14px;padding:10px;">Hi {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME},</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding: 20px 10px;">We just wanted to remind you that you have an upcoming performance of {ASSIGNMENT_NAME} at the following event: {EVENT_DETAILS}. With one week to go, you should play through the piece through several times. Have your friends and family listen to your performances. Please let your teacher know if you have any questions about the piece. All the best Cheers!</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding:10px; ">Thanks<br />\r\n			Practicia Team<br />\r\n			www.practicia.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{EVENT_DETAILS}', 'publish'),
(11, 'Good Luck on Assignment Tomorrow!', 'good_luck_on_assignment_tomorrow', 'Good Luck on {ASSIGNMENT_NAME} Tomorrow!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="font-size:14px;padding:10px;">Hi {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME},</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding: 20px 10px;">We just wanted to remind you that you have an upcoming performance of {ASSIGNMENT_NAME} at the following event: {EVENT_DETAILS}. Congrats, you have come a long way and are ready to rock tomorrow! Now relax and get excited. All the best!</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding:10px; ">Thanks<br />\r\n			Practicia Team<br />\r\n			www.practicia.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{EVENT_DETAILS}', 'publish'),
(12, 'Student, You have a new assignment!', 'student_you_have_a_new_assignment', '{STUDENT_LASTNAME}, {STUDENT_FIRSTNAME}, You have a new assignment!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="font-size:14px;padding:10px;">Hi {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME},</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding: 20px 10px;">You have been given a new assignment: {ASSIGNMENT_NAME}. Please login to your PRACTICIA App and look at your assignments TAB to check out the details. Happy Practicing! The PRACTICIA Team</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding:10px; ">Thanks<br />\r\n			Practicia Team<br />\r\n			www.practicia.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}', 'publish'),
