(16, 'Student Event Information Updated', 'student_event_information_updated', 'Event Information Updated', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="font-size:14px;padding:10px;">Hi {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME},</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding: 20px 10px;">Your Teacher {TEACHER_LASTNAME}, {TEACHER_FIRSTNAME} would has updated information for the following event: {EVENT_NAME} at which you are playing {ASSIGNMENT_NAME}. Please note any changes and let your teacher know if you have any qustions. Thanks!</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding:10px; ">Thanks<br />\r\n			Practicia Team<br />\r\n			www.practicia.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{EVENT_NAME} \r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}', 'publish'),
