(24, 'Student is playing at an Event!', 'student_is_playing_at_an_event', '{STUDENT_LASTNAME}, {STUDENT_FIRSTNAME} is playing at an Event!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="font-size:14px;padding:10px;">Hi {PARENT_LASTNAME}, {PARENT_FIRSTNAME},</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding: 20px 10px;">{TEACHER_LASTNAME}, {TEACHER_FIRSTNAME} would like {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME} to perform {ASSIGNMENT_NAME} at the following event: {EVENT_DETAILS}. So exciting! Please contact your teacher if you have any questions. All the best and happy practicing!</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding:10px; ">Thanks<br />\r\n			Practicia Team<br />\r\n			www.practicia.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{EVENT_DETAILS}\r\n{PARENT_LASTNAME}\r\n{PARENT_FIRSTNAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}', 'publish'),
(8, 'Your Upcoming Performance of Assignment, 3 Weeks to go!', 'your_upcoming_performance_of_assignment_3_weeks_to_go', 'Your Upcoming Performance of {ASSIGNMENT_NAME}, 3 Weeks to go!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td colspan="2" style="font-size:14px;padding:10px;">Hi {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding: 20px 10px;">We just wanted to remind you that you have an upcoming performance of {ASSIGNMENT_NAME} at the following event: {EVENT_DETAILS}. With three weeks to go, you should start working on any final technical challenges in the piece. Play large sections, even entire pieces at this point. Please let your teacher know if you have any questions about the piece. Good luck, we will check in again next week! Cheers!</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding:10px; ">Thanks<br />\r\n						Practicia Team<br />\r\n						www.practicia.com</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{EVENT_DETAILS}', 'publish'),
(25, 'Parent Event Information Updated', 'parent_event_information_updated', 'Event Information Updated', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="font-size:14px;padding:10px;">Hi {PARENT_LASTNAME}, {PARENT_FIRSTNAME},</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding: 20px 10px;">{TEACHER_LASTNAME}, {TEACHER_FIRSTNAME} would has updated information for the following event: {EVENT_NAME} at which {STUDENT_LASTNAME}, {STUDENT_FIRSTNAME} is playing {ASSIGNMENT_NAME}. Please note any changes and let your teacher know if you have any qustions. Thanks!</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="padding:10px; ">Thanks<br />\r\n			Practicia Team<br />\r\n			www.practicia.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{EVENT_NAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{PARENT_LASTNAME}\r\n{PARENT_FIRSTNAME}', 'publish'),
(26, 'contact us form', 'contact_us_form', 'contact us form', 'practicia', '', 'No Reply', '', '', '<p>{NAME}</p>\r\n\r\n<p>{EMAIL}</p>\r\n\r\n<p>{PHONE}</p>\r\n\r\n<p>{CONTENT}</p>\r\n\r\n<p>Â </p>\r\n\r\n<p>Â </p>\r\n\r\n<p>Thankyou</p>\r\n', '{NAME}\r\n{EMAIL}\r\n{PHONE}\r\n{CONTENT}', 'publish'),
(27, 'Student practiced Assignment', 'student_practiced_assignment', '{STUDENT_LASTNAME} {STUDENT_FIRSTNAME} practiced {ASSIGNMENT_NAME}', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td colspan="2" style="font-size:14px;padding:10px;">Hi {TEACHER_LASTNAME} {TEACHER_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding: 20px 10px;">We wanted to inform you that {STUDENT_LASTNAME} {STUDENT_FIRSTNAME} practiced {ASSIGNMENT_NAME} for {PRACTICE_MINUTES} Minutes. You can view/listen to this practice session inside your PRACTICIA App.</td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan="2" style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team<br />\r\n						www.practicia.com</td>\r\n					</tr>\r\n					<tr>\r\n						<td>PS. If you wish to change this particular alert, you can always do so in the settings section in the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{PRACTICE_MINUTES}', 'publish'),
(28, 'Wow STUDENT won AWARD for their practice!', 'wow_student_won_award_for_their_practice', 'Wow... {STUDENT_LASTNAME} {STUDENT_FIRSTNAME} won {AWARD_NAME} for their practice!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {TEACHER_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">Congrats {TEACHER_FIRSTNAME}, You''ve got a hard worker! {STUDENT_LASTNAME} {STUDENT_FIRSTNAME} won {AWARD_NAME}! Do log in to the award TAB in your home screen to view this award. At their next lesson, please do congratulate {STUDENT_LASTNAME} {STUDENT_FIRSTNAME} on their hard work. Also, you can brag about their accomplishments on your favorite social media sites such as Facebook and Twitter. Here is a video that shows how to do just that: {VIDEO_LINK}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Thanks<br />\r\n						Practicia Team<br />\r\n						www.practicia.com</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">PS. If you wish to change this particular alert, you can always do so in the settings section in the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{AWARD_NAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{VIDEO_LINK}', 'publish'),
(29, 'PRACTICIA {DAILY/WEEKLY/MONTHLY} Digest', 'practicia_dailyweeklymonthly_digest', 'PRACTICIA {DAILY/WEEKLY/MONTHLY} Digest', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {TEACHER_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">Here is a summary of all practice activity that happened in your studio {TODAY/THIS_WEEK/THIS_MONTH}. Hope you will find it useful.</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">{STUDENT_PRACTICE_DETAIL}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Practicia Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">PS. If you wish to change this particular alert, you can always do so in the settings section in the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{STUDENT_PRACTICE_DETAIL}\r\n{DAILY/WEEKLY/MONTHLY}\r\n{TODAY/THIS_WEEK/THIS_MONTH}', 'publish'),
(30, 'PRACTICIA {DAILY/WEEKLY/MONTHLY} Trends', 'practicia_dailyweeklymonthly_trends', 'PRACTICIA {DAILY/WEEKLY/MONTHLY} Trends', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {TEACHER_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">Here is your {DAILY/WEEKLY/MONTHLY} PRACTICIA TRENDS report. Hope you will be able to use the information below to better assess how your studio/class is doing and how you can help them practice better!</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Practice Trends Report for {TIME_PERIOD}<br />\r\n						Stats:<br />\r\n						1. Average Time Practiced: {AVERAGE_TIME_PRACTICED} mins<br />\r\n						2. Average Number of Days Practiced: {AVERAGE_DAYS_PRACTICED}<br />\r\n						3. Average Time Practiced Per Day: {AVERAGE_TIME_PACTICED_PER_DAY} Mins<br />\r\n						4. Average % Assignments Practiced: {AVERAGE_ASSIGNMENT_PRACTICED}%<br />\r\n						5. Average Lesson Rating: {AVERAGE_LESSION_RATING} (out of 5)<br />\r\n						<br />\r\n						Practice Breakdown (by Assignment Type) :<br />\r\n						{PRACTICE_BREAKDOWN_BY_ASSIGNMENT_TYPE}<br />\r\n						Top 5 Assignments Practiced:<br />\r\n						{TOP_5_ASSIGNMENTS_PRACTICED}<br />\r\n						Top Five Students:<br />\r\n						{TOP_FIVE_STUDENTS}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">PS. If you wish to change this particular alert, you can always do so in the settings section in the PRACTICIA Mobile App</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Practicia Team</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{DAILY/WEEKLY/MONTHLY}\r\n{AVERAGE_TIME_PRACTICED}\r\n{AVERAGE_DAYS_PRACTICED}\r\n{AVERAGE_TIME_PACTICED_PER_DAY}\r\n{AVERAGE_ASSIGNMENT_PRACTICED}\r\n{AVERAGE_LESSION_RATING}\r\n{PRACTICE_BREAKDOWN_BY_ASSIGNMENT_TYPE}\r\n{TOP_5_ASSIGNMENTS_PRACTICED}\r\n{TOP_FIVE_STUDENTS}\r\n{TIME_PERIOD}', 'publish'),
(31, 'Missing in Action Today!', 'missing_in_action_today', 'Missing in Action Today!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {TEACHER_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">Below is a list of students who missed practice today. Hope you find it useful.</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">{STUDENT_LIST}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LIST}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}', 'publish'),
(32, 'STUDENT, We Miss you!', 'student_we_miss_you', ' {STUDENT_FIRSTNAME}, We Miss you!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {STUDENT_LASTNAME} {STUDENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">You had asked us to remind you when you had missed {MISSED_DAYS} or more days of practice so we wanted to send you this gentle reminder. Hope you are ok. We miss seeing you in action!<br />\r\n						Looking forward to having you log back into PRACTICIA and resuming your practice.</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{MISSED_DAYS}', 'publish');
INSERT INTO `email_template` (`id`, `title`, `name`, `subject`, `from_name`, `replyto`, `replyto_name`, `cc`, `bcc`, `details`, `variables`, `status`) VALUES
(33, 'New Award Created by TEACHER!', 'new_award_created_by_teacher', 'New Award Created by {TEACHER_LASTNAME} {TEACHER_FIRSTNAME}!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {STUDENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">\r\n						<p>We wanted to let you know of a new award that has been created by {TEACHER_LASTNAME} {TEACHER_FIRSTNAME} on PRACTICIA:<br />\r\n						Award Title: {AWARD_NAME}<br />\r\n						Award Type: {AWARD_TYPE} based<br />\r\n						<strong>Award Criteria</strong><br />\r\n						{AWARD_DETAILS}</p>\r\n\r\n						<p>Award Active from {FROM_DATE} to {TO_DATE}<br />\r\n						Hope you practice hard and win this award in no time!!</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{AWARD_NAME}\r\n{AWARD_TYPE}\r\n{FROM_DATE}\r\n{TO_DATE}\r\n{AWARD_DETAILS}', 'publish'),
(34, 'Whoa, you won an award!', 'whoa_you_won_an_award', 'Whoa, you won an award!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {STUDENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">\r\n						<p>Congratulations! You won the following award on PRACTICIA:<br />\r\n						Award Title: {AWARD_NAME}<br />\r\n						Award Type: {AWARD_TYPE} based<br />\r\n						Teacher: {TEACHER_LASTNAME} {TEACHER_FIRSTNAME}<br />\r\n						<strong>Award Criteria:</strong><br />\r\n						{AWARD_DETAILS}</p>\r\n\r\n						<p>Award Active from {FROM_DATE} to {TO_DATE}<br />\r\n						Please log in to your PRACTICIA app to share this accomplishment on your favorite social sites!</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{AWARD_NAME}\r\n{AWARD_TYPE}\r\n{FROM_DATE}\r\n{TO_DATE}\r\n{AWARD_DETAILS}', 'publish'),
(35, 'You received a comment on your PRACTICE!', 'you_received_a_comment_on_your_practice', 'You received a comment on your PRACTICE!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {STUDENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">You received a comment from your teacher on PRACTICIA:<br />\r\n						Comment: {TEACHER_COMMENT}<br />\r\n						Assignment Name: {ASSIGNMENT_NAME}<br />\r\n						Teacher: {TEACHER_LASTNAME} {TEACHER_FIRSTNAME}<br />\r\n						Practiced on: {PRACTICE_DATE_TIME}<br />\r\n						Please log in to your PRACTICIA app to listen to this practice session and read the comment!</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{TEACHER_COMMENT}\r\n{PRACTICE_DATE_TIME}', 'publish'),
(36, 'You have pending Uploads on PRACTICIA', 'you_have_pending_uploads_on_practicia', 'You have pending Uploads on PRACTICIA', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {STUDENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">You have pending uploads on PRACTICIA. Its very important that your practice be uploaded so your teacher knows you have practiced. Once you have an internet connection, you can go to the pending upload screen in the slide out menu and hit resume, and that should take start the process. Here is a quick 30 second video on how to do just that: {VIDEO_LINK}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}', 'publish'),
(37, 'We have not seen STUDENT in the practice room!', 'we_have_not_seen_student_in_the_practice_room', 'We have not seen {STUDENT_FIRSTNAME} in the practice room!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {PARENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">You had asked us to remind you when {STUDENT_FIRSTNAME} had missed {MISSED_DAYS} or more days of practice so we wanted to send you this gentle reminder. Hope you and {STUDENT_FIRSTNAME} are ok. We miss seeing {STUDENT_FIRSTNAME} in action!</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{PARENT_LASTNAME}\r\n{PARENT_FIRSTNAME}\r\n{MISSED_DAYS}', 'publish'),
(38, 'Parent New Award Created by TEACHER!', 'parent_new_award_created_by_teacher', 'New Award Created by {TEACHER_LASTNAME} {TEACHER_FIRSTNAME}!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {PARENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">We wanted to let you know of a new award that has been created by {TEACHER_LASTNAME} {TEACHER_FIRSTNAME} on PRACTICIA:<br />\r\n						Award Title: {AWARD_NAME}<br />\r\n						Award Type: {AWARD_TYPE} based<br />\r\n						<strong>Award Criteria</strong><br />\r\n						{AWARD_DETAILS}<br />\r\n						Award Active from {FROM_DATE} to {TO_DATE}<br />\r\n						Please do encourage your child to practice so they have a shot at winning this award!</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{PARENT_LASTNAME}\r\n{PARENT_FIRSTNAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{AWARD_NAME}\r\n{AWARD_TYPE}\r\n{FROM_DATE}\r\n{TO_DATE}\r\n{AWARD_DETAILS}', 'publish'),
(39, 'Whoa, STUDENT won an award!', 'whoa_student_won_an_award', 'Whoa, {STUDENT_FIRSTNAME} won an award!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {PARENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">Congratulations! {STUDENT_FIRSTNAME} won the following award on PRACTICIA:<br />\r\n						Award Title: {AWARD_NAME}<br />\r\n						Award Type: {AWARD_TYPE} based<br />\r\n						Teacher: {TEACHER_LASTNAME} {TEACHER_FIRSTNAME}<br />\r\n						<strong>Award Criteria:</strong><br />\r\n						{AWARD_DETAILS}\r\n						<p>Award Active from {FROM_DATE} to {TO_DATE}<br />\r\n						Please log in to your PRACTICIA app to share this accomplishment on your favorite social sites!</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{PARENT_LASTNAME}\r\n{PARENT_FIRSTNAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{AWARD_NAME}\r\n{AWARD_TYPE}\r\n{FROM_DATE}\r\n{TO_DATE}\r\n{AWARD_DETAILS}', 'publish'),
(40, 'STUDENT, received a comment on your PRACTICE!', 'student_received_a_comment_on_your_practice', '{STUDENT_FIRSTNAME}, received a comment on your PRACTICE!', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {PARENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">You received a comment from your teacher on PRACTICIA:<br />\r\n						Comment: {TEACHER_COMMENT}<br />\r\n						Assignment Name: {ASSIGNMENT_NAME}<br />\r\n						Teacher: {TEACHER_LASTNAME} {TEACHER_FIRSTNAME}<br />\r\n						Practiced on: {PRACTICE_DATE_TIME}<br />\r\n						Please log in to your PRACTICIA app to listen to this practice session and read the comment!</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{STUDENT_LASTNAME}\r\n{STUDENT_FIRSTNAME}\r\n{ASSIGNMENT_NAME}\r\n{PARENT_LASTNAME}\r\n{PARENT_FIRSTNAME}\r\n{TEACHER_LASTNAME}\r\n{TEACHER_FIRSTNAME}\r\n{TEACHER_COMMENT}\r\n{PRACTICE_DATE_TIME}', 'publish'),
(41, 'There are practice sessions waiting for your approval on PRACTICIA', 'there_are_practice_sessions_waiting_for_your_approval_on_practicia', 'There are practice sessions waiting for your approval on PRACTICIA', 'Practicia', '', 'No Reply', '', '', '<table border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#edeff0;font-family:Verdana, Roboto,Open Sans,Verdana, Roboto,Open Sans, Arial,Tahoma, Helvetica, sans-serif;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align="center" border="0" cellpadding="2" cellspacing="1" style="letter-spacing:1px;background-color:#FFF;" width="600px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="font-size:14px;padding:10px;">Hi {PARENT_FIRSTNAME},</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">We noticed that you have pending practice approvals on PRACTICIA. Until you approve, these practice sessions are not going to get logged in the system and the teacher will not be notified that your child has practiced. Please approve these practice sessions ASAP. Here is a quick video on how to do this: {VIDEO_LINK}</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding:10px; ">Cheers,<br />\r\n						The PRACTICIA Team</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="padding: 20px 10px;">PS. If you wish to stop receiving this particular report, you can always do so by turning it off in the settings from the PRACTICIA Mobile App</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '{PARENT_LASTNAME}\r\n{PARENT_FIRSTNAME}\r\n', 'publish');
